/**
 * @param {number[]} nums1
 * @param {number[]} nums2
 * @return {number}
 */
var minSum = function(nums1, nums2) {
    let sum1 = nums1.reduce((acc, val) => acc + val, 0);
    let sum2 = nums2.reduce((acc, val) => acc + val, 0);
    let zeros1 = nums1.filter(val => val === 0).length;
    let zeros2 = nums2.filter(val => val === 0).length;

    if (sum1 > sum2 && zeros2 === 0 || sum2 > sum1 && zeros1 === 0) {
        return -1;
    }

    let diff = Math.abs(sum1 - sum2);
    let totalZeros = zeros1 + zeros2;

    if (diff % totalZeros === 0) {
        return Math.max(sum1, sum2) + diff / totalZeros * zeros1;
    } else {
        return Math.max(sum1, sum2) + Math.ceil(diff / totalZeros) * totalZeros;
    }
};
